%[text] #### Question 3:
%[text] Given the following system T{x(t)} = t \* \[x(t)\] ^2 show by hand whether the system is linear or not, then write a MATLAB script which confirms your theoretical calculation. Do this by considering 2 inputs: x1 = u(t) and x2 = 2u(t-1) for t = -5 to 5 with step size = 0.01, and each scaled respectively by constants a = 3 and b = -1 and passing this through the transformation T. 
%[text] The system is linear if and only if T(a\*x1 + b\*x2) == a\*T(x1) + b\*T(x2). Use a numerical comparison by taking the norm of both sides and showing if they are equal or not. Let the threshold be 1E-6.
